class Solution {
    func maxSum(_ nums: [Int], _ m: Int, _ k: Int) -> Int {
        var result = 0
        var windowSum = 0
        var freq = [Int: Int]()

        for i in 0..<k {
            windowSum += nums[i]
            freq[nums[i], default: 0] += 1
        }
        if freq.count >= m {
            result = max(result, windowSum)
        }

        for i in k..<nums.count {
            windowSum += nums[i] - nums[i-k]
            freq[nums[i], default: 0] += 1
            freq[nums[i-k]]! -= 1
            if freq[nums[i-k]]! == 0 {
                freq.removeValue(forKey: nums[i-k])
            }

            if freq.count >= m {
                result = max(result, windowSum)
            }
        }

        return result
    }
}
